import React from 'react'

const Post = () => {
 const {post} = this.props
 return (
   <button key={post._id}>
     <h3>{post.title}</h3>
     <span>{!post.createAt ? null : renderDate(post.createAt)}</span>
     <div>{renderTags(post.tags)}</div>
   </button>
 )
}

export default Post
